import styled from "styled-components";

export const Container = styled.div`
  padding: 1.5rem;
  height: 100vh;
  width: 100%;

  .Navbar {
    display: flex;
    justify-content: space-between;
    align-content: center;
    align-items: center;
    justify-items: center;
    width: 100%;
  }

  .alerts {
    color: red;
    background-color: #e4eeb7;
    width: fit-content;
    padding: 0.5rem 0.75rem;
    border-radius: 50%;
  }

  .footer {
    display: flex;
    /* align-content: center; */
    align-items: center;
    justify-items: center;
    justify-content: flex-end;
    position: relative;
    width: 100%;
    bottom: 0;
    color: white;
    font-size: 25px;
    height: 2rem;
    background-color: #e4eeb7;
    margin-bottom: 1rem;
  }
`;
